import React, { Component } from "react";
import Checkbox from "./Checkbox";

export default class ChoiceContainer extends Component {
  state = {
    checked: false
  }

  onCheckboxChange = () => {
    console.log("clicked on change in filter item");
  };
  render() {
    return <Checkbox name="test" onChange={this.onCheckboxChange} />;
  }
}
